import { axios } from 'axios';
import NextVideo from '../NextVideo/NextVideo';


const apiVideoUrl = 'https://project-2-api.herokuapp.com/videos?api_key=%3C123%3E'

export default function getVideo() {
    axios ({
        method: 'get',
        url: apiVideoUrl,
    }).then((response)=> {
        NextVideo(response.data)
        console.log(response.data);
    })
}
